def trainmodel():
    label_encoder = LabelEncoder()
    df2.manufacturer = label_encoder.fit_transform(df.manufacturer)
    df2.model = label_encoder.fit_transform(df.model)
    df2.condition = label_encoder.fit_transform(df.condition)
    df2.fuel = label_encoder.fit_transform(df.fuel)
    df2.transmission = label_encoder.fit_transform(df.transmission)
    df2.type = label_encoder.fit_transform(df.type)
    train_dataset = df2.sample(frac=0.8, random_state=0)
    test_dataset = df2.drop(train_dataset.index)
    train_features = train_dataset.copy()
    test_features = test_dataset.copy()
    train_labels = train_features.pop('price')
    test_labels = test_features.pop('price')
    rfr_model = RandomForestRegressor(n_estimators=180, random_state=0, min_samples_leaf=1, max_features=0.5)
    return rfr_model.fit(train_features, train_labels)
rfr_model = trainmodel()
