def convertNameToNum(df, labeledDf, value, columnName):
    index = df.index
    condition = df[columnName] == value
    indices = index[condition]
    return labeledDf[columnName].values[indices[0]]


def predict(year, manufacturer, model, condition, fuel, odometer, transmission, type, rfr_model):
    test_data = np.array(
        [year, convertNameToNum(df, df2, manufacturer, 'manufacturer'),
         convertNameToNum(df, df2, model, 'model'),
         convertNameToNum(df, df2, condition, 'condition'),
         convertNameToNum(df, df2, fuel, 'fuel'),
         odometer,
         convertNameToNum(df, df2, transmission, 'transmission'),
         convertNameToNum(df, df2, type, 'type')])
    predicted_price = rfr_model.predict(test_data.reshape(1, 8))
    return int(predicted_price)


